import React from 'react';
import Text from "../../helpers/Text";

function IconAndText({icon, text}) {
    return (
        <>
            <div style={{
                marginBottom: "15%"
            }}></div>

            <div className="row">

                <div>
                    <img src={icon}/>
                </div>
                <div>
                    <Text text={text} fontWeight={400} size={"0.8rem"}/>
                </div>

            </div>
        </>
    );
}

export default IconAndText;
